var canvas = document.getElementById('canvas');
var ctx = canvas.getContext('2d');
let s = new Shapes(ctx);

canvas.width = innerWidth;
canvas.height = innerHeight;

var store1 = [];
addEventListener('keypress', (e)=> {
	if (e.key == 'a') {
		ctx.setTransform(1, 0, 0, 1, 0, 0);
		ctx.clearRect(0, 0, canvas.width, canvas.height);
		ctx.drawImage(img, 0, 0);
		//pixelPos();
		imagedata = ctx.getImageData(0, 0, img.width, img.height);
		dat = imagedata.data;
		ctx.clearRect(0, 0, canvas.width, canvas.height);
		//ctx.clearRect();
		for(var y = 0; y < img.height; y += radii) {
		  	for(var x = 0; x < img.width; x += radii) {

		    	if (dat[((img.width * y) + x) * 4] > 0) {
		    		red = 255-dat[((img.width * y) + x) * 4];
			    	green = 255-dat[((img.width * y) + x) * 4 + 1];
			    	blue = 255-dat[((img.width * y) + x) * 4 + 2];
			    	alpha = dat[((img.width * y) + x) * 4 + 3];
			    	var clr = 'rgba('+ red + ',' + green + ',' + blue + ',' + alpha +')';

			    	store1.push(new Particle(x+200, y+200, clr));
		    	}
		 	}
		}
		let i = 0;
		let inter = setInterval(()=> {
			store[i] = store1[i];
			i++;
			if (store[i] == undefined) {
				clearInterval(inter);
			}
		}, 10);
	}
});
addEventListener('resize', function(e) {
	canvas.width = innerWidth;
	canvas.height = innerHeight;
});

//============================================================================================================================
var store = [], radii = 2;
var imagedata, dat;
var img = new Image();
img.src = 'data:image/png;base64,';
var red, green, blue, alpha;
/*var im = new Image();
im.src = 'data:image/png;base64,';
*/
class Particle{
	constructor(x, y, color) {
		this.pos = new Vector2D(x, y);
		this.c = color;
		this.r = radii;
		this.Opos = new Vector2D(x, y);
	}
	
	draw() {
		s.box(this.pos.x-this.r/2, this.pos.y-this.r/2, this.r, this.r);
		s.fill(this.c);
	}
	update() {
		this.draw();
	}
}

function imgLoad() {
	ctx.setTransform(1, 0, 0, 1, 0, 0);
	ctx.clearRect(0, 0, canvas.width, canvas.height);
	store.length = 0;
	ctx.drawImage(img, 0, 0);
	//pixelPos();
	imagedata = ctx.getImageData(0, 0, img.width, img.height);
	dat = imagedata.data;
	ctx.clearRect(0, 0, canvas.width, canvas.height);
	//ctx.clearRect();
	for(var y = 0; y < img.height; y += radii) {
	  	for(var x = 0; x < img.width; x += radii) {

	    	if (dat[((img.width * y) + x) * 4] > 0) {
	    		red = dat[((img.width * y) + x) * 4];
		    	green = dat[((img.width * y) + x) * 4 + 1];
		    	blue = dat[((img.width * y) + x) * 4 + 2];
		    	alpha = dat[((img.width * y) + x) * 4 + 3];
		    	var clr = 'rgba('+ red + ',' + green + ',' + blue + ',' + alpha +')';

		    	store.push(new Particle(x+200, y+200, clr));
	    	}
	 	}
	}
}
img.onload = () => {
	imgLoad();
};

(function animation() {
	ctx.setTransform(1, 0, 0, 1, 0, 0);
	ctx.clearRect(0, 0, canvas.width, canvas.height);

	store.forEach((balls) => {
		balls.update();
	});

	requestAnimationFrame(animation);
})();
